import React from "react";
import "./styles.css";

export default function App() {
  return (
    <div className="App">
      <h1 className="title">Quotes Generator</h1>
      <p className="quotes">This is a quote</p>
      <p className="author">- author name</p>
      <button className="button">New Quote</button>
    </div>

  );
}
